export const FilterResultsCategories = (searchTerm = '') => {
    console.log('FilterResultsCategories', searchTerm);

    return {
        action: 'RESULT_CATEGORIES_FILTERED',
        payload: ['test1', 'test2', 'test3'] 
        };
}


export const FilterResultsDetails = (searchTerm = '') => {
    console.log('FilterResultsDetails', searchTerm);

    return (
        {
            type: 'RESULT_DETAIL_FILTERED',
            payload: {
                        "climate": "Arid",
                        "diameter": "10465",
                        "gravity": "1 standard",
                        "name": "Tatooine",
                        "orbital_period": "304",
                        "population": "200000",
                        "residents": [
                        "https://swapi.co/api/people/1/",
                        "https://swapi.co/api/people/2/"
                        ]
                }
        });
}
